import axios from "axios"

const api = axios.create({
    baseURL: 'https://lifehealthyexpectancy.herokuapp.com',
})

export const ApiService = {
    fetchData: async (params) => {
       const data = await api.get('/life-expectancy-data', params)
       return data
    }
}
